// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Lesson15 {
    // Создание enum с опциями для "Доставки"
    enum Status {
      Pending,
      Shipped,
      Accepted,
      Rejected,
      Canceled  
    }
    // Значение по умолчанию - первый элемент в enum - Pending

    // Установка enum в переменную
    Status public status;

    // Возвращает индекс опций
    // Pending  - 0
    // Shipped  - 1
    // Accepted - 2
    // Rejected - 3
    // Canceled - 4

    uint256 public myVar;
    uint private secVar;
    int internal threeVar;

    string public myStr;
    string private secStr;
    string internal threeStr;

    address public myAddr;
    address private secAddr;
    address payable threeAddr;

    bool public myBool;
    bool private secBiool;
    bool internal threeBool;
    bool public comparisonResult;

    uint256 constant FIXED = 57;
    string constant STRFIXED = "Hello!";
    // Создание мэппинга с ключом address и значениями типа uint
    mapping (address => uint) private balances;

    // Мэппинг в мэпиинге (Payments mapping) 
    mapping (address => mapping (uint => bool)) public payments;

    // Способы создания массивов
    uint[] public arr;
    uint[] public arr2 = [1, 2, 3];
    // Массив с фиксированной длинной, где все значения = 0
    uint[10] public myFixedSizeArray;



    //ОПЕРАТОРЫ СРАВНЕНИЯ //

    // Функция проверяет равна ли переменная с введенным значением, если "да",
    //то показывается true, если "нет" - false;
    function getBoolOne(bool _argBool) external view returns (bool) {
        return myBool == _argBool ? true : false; // тернарный оператор
    }

    // Функция проверяет, что переменная НЕ равна с введенным значением. Если значения "не равны",
    //то показывается true, если "равны" - false;
    function getBoolTwo(bool _argBool) external view returns (bool) {
        return myBool != _argBool ? true : false;
    }

    //Функция проверяет, что обе переменны должны быть "true". Если хоть одна из них не "true", 
    //то результатом будем "false".
    function getBoolThreee(bool _argBool) external view returns (bool) {
        return myBool && _argBool ? true : false;
    }

    //Функция проверяет, что ХОТЯ БЫ одна переменная должны быть "true". Если хоть одна из них "true", 
    // то результатом будем "true".
    function getBoolFour(bool _argBool) external view returns (bool) {
        return myBool || _argBool ? true : false;
    }

    // ПРОСТЫЕ МАТЕМАТИЧЕСКИЕ ОПЕРАЦИИ //

    //Простая математическая функция
    function inc() external view returns (uint256) {
        return (myVar + FIXED) * 10;
    }

    //Простая функция вычитания 1 из числа
    function dec() external returns (uint256) {
        return --myVar;
    }

    // Пример переполнения и отката транзакции, работает, если maxVal == 255
    function ovwerFlow() external returns (uint256) {
        return myVar = myVar + 1;
    }

    // ПРИМЕРЫ ВЗАИМОДЕЙСТВИЯ С МАППИНГАМИ //

    function getAddr(address newAddr) public view returns (uint) {
        // Получение значений по ключу
        // Если значение не найдено, то функция вернет 0
        return balances[newAddr];
    } 

    function setAddr (address _addr, uint _balance) public {
        // Обновление значения по ключу
        balances[_addr] = _balance;
    }

    function delAddr(address _addr) public {
        // Обнуление значения по ключу
        delete balances[_addr];
    }

    function getPayments(address _addr, uint _balance) public view returns (bool) {
        // Получение значения из payments mapping. Получает значение bool с ключом uint для ключа address
        return payments[_addr][_balance];
    }

    function setPayments(address _addr, uint _balance, bool _boo) public {
        payments[_addr][_balance] = _boo;
    }

    // Получение элемента массива по индексу
    function get(uint i) public view returns (uint) {
        return arr[i];
    }

    // Так можно получить весь массив. 
    // Однако нужно избегать такого решения со слишком большими массивами,
    // так как они могут использовать весь газ и обвалить транзакцию
    function getArr() public view returns (uint[] memory) {
        return arr;
    }

    function pushArr(uint i) public {
        // Добавление значения в массив. 
        // В данном случае можно добавить число
        arr.push(i);
    }

    function popArr() public {
        // Удаление последнего элемента из массива
        // Также уменьшает его длину
        arr.pop();
    }

    //Получение длины массива
    function getLengthArr() public  view returns (uint) {
        return arr.length;
    }

    function removeArr(uint index) public {
        // Обнуление значения по индексу
        // Не изменяет длину массива
        delete arr[index];
    }

    function examplesArr() external pure {
        // Так создаются массивы с фиксированной длиной в функциях
        // Массив с динамической длиной в функции создать невозможно
        uint[] memory a = new uint[](5);
        a[0] = 1;
    }

    function getEnum() public view returns (Status) {
        //Получение значения переменной
        return status;
    }

    // Update status by passing uint into input
    function setEnum(Status _status) public {
        //Установка опций в переменную
        status = _status;
    }

    // Обновление опции в переменной напрямую
    function cancelEnum() public {
        status = Status.Canceled;
    }

    // Обнуление переменной - установка опции по умолчанию - Pending
    function resetEnum() public {
        delete status;
    }

    function testRequire(uint _i) public pure {
        //ошибка с require
        require(_i > 10, "Input must be greater than 10");
    }

    function testReveert(uint _i) public pure {
        if (_i > 10) {
            revert("Input must be greater than 10");
        }
    }

    function testAssert() public  view  {
        assert((myVar == 0));
    }

    // Созданная пользователем ошибка
    error InsufficientBalance(uint balance, uint withdrawAmmount);

    function testCustomError(uint _withdrawAmmount) public view  {
        uint bal = address(this).balance;
        if (bal < _withdrawAmmount) {
            //вызов пользовательской ошибки
            revert InsufficientBalance({balance: bal, withdrawAmmount: _withdrawAmmount});
        }
    }

    // Функция для установки начальных значений переменных
    function iniziallize(uint _number, address _newAddr) public {
        myVar = _number;
        myAddr = _newAddr;
    }

    // Функция для инкремента числа
    function incrementNimber() public {
        myVar +=1;
    }
          
    // Функция для сравнения адресов
    function compareAddresses(address _addressToCompare) public {
        comparisonResult = (myAddr == _addressToCompare);
    }

    // Функция с использованием тернарного оператора
    function ternarnyOperation(uint _i) public {
        comparisonResult = (myVar > _i ? true : false);
    }
}

